import React from 'react';
import styled from 'styled-components';

// Стилі для заголовку
const HeaderContainer = styled.header`
  position: relative;
  display: flex;
  justify-content: space-between;
  align-items: center;
  min-width: 320px;
`;

const LogoThumb = styled.div`
  padding-top: 166px;
  padding-left: 221px;
  background-image: url(./components/img/logo-tabaco.svg);
  margin-left: 100px;
  margin-top: 24px;
`;

const Menu = styled.div`
  padding-left: 100px;
  padding-top: 49px;
`;

const SiteNav = styled.ul`
  display: flex;
  gap: 50px;
  list-style: none;
`;

const SiteNavItem = styled.li`
  margin-bottom: 32px;
`;

const SiteNavLink = styled.a`
  font-family: 'Josefin Sans', sans-serif;
  font-style: normal;
  font-weight: 600;
  font-size: 20px;
  line-height: 28px;
  color: #E4E2DD;
  text-decoration: none;
`;

// Компонент Header
function Header() {
  return (
    <HeaderContainer>
      <LogoThumb></LogoThumb>
      <Menu>
        <nav>
          <SiteNav>
            <SiteNavItem>
              <SiteNavLink href="./index.html">Головна</SiteNavLink>
            </SiteNavItem>
            <SiteNavItem>
              <SiteNavLink href="./goods.html">Товари</SiteNavLink>
            </SiteNavItem>
          </SiteNav>
        </nav>
      </Menu>
    </HeaderContainer>
  );
}

export default Header;
